import React from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import axios from "axios";
import "./feedback.css"; // Import CSS file
import { useInitialContext } from "../context/InitialContext";

// Axios Instance
const ai = axios.create({
  baseURL: "https://railwaymcq.com/student/dbfeedback_api.php",
});

export default function FeedBack_user(props) {
  const { zoneAndDivisionData, departmentData, SetZoneAndDivision } =
    useInitialContext();

  const validationSchema = Yup.object().shape({
    zone: Yup.string().required("Please select a zone"),
    division: Yup.string().required("Please select a division"),
    deptt: Yup.string().required("Please select a department"),
    message: Yup.string().required("Please provide feedback message"),
    message_by: Yup.string().required("Please enter your name"),
  });

  const handleSubmit = async (values, { resetForm }) => {
    try {
      const response = await axios.post(
        "https://railwaymcq.com/student/dbfeedback_api.php",
        values
      );
      console.log("Data added successfully:", response.data);
      alert("Data added successfully");
      resetForm();
    } catch (error) {
      console.error("Error adding data:", error);
    }
  };

  useEffect(() => {
    SetZoneAndDivision();
  }, [SetZoneAndDivision]);

  return (
    <div className="feedback-container">
      <Formik
        initialValues={{
          zone: "",
          division: "",
          deptt: "",
          message: "",
          message_by: "",
        }}
        validationSchema={validationSchema}
        onSubmit={handleSubmit}
      >
        {({ isSubmitting }) => (
          <Form>
            <h6>{props.heading}</h6>
            <Field as="select" className="form-select" name="zone">
              <option value="">Please select Zone</option>
              {zoneAndDivisionData &&
                zoneAndDivisionData.map((zones, index) =>
                  Object.entries(zones).map(([zone], index) => (
                    <option key={index} value={zone}>
                      {zone}
                    </option>
                  ))
                )}
            </Field>
            <ErrorMessage name="zone" component="p" className="error" />

            <Field as="select" className="form-select" name="division">
              <option>Please select Division</option>
              {zoneAndDivisionData?.map((zones, zoneIndex) => {
                return Object.entries(zones)?.map(([zone, divisions]) => {
                  if (zone === zone) {
                    return divisions.map((division, divisionIndex) => {
                      return (
                        <option key={divisionIndex} value={division}>
                          {division}
                        </option>
                      );
                    });
                  }
                  return null; // Return value for map
                });
              })}
            </Field>
            <ErrorMessage name="division" component="p" className="error" />

            <Field as="select" className="form-select" name="deptt">
              <option>Please select Department</option>
              {departmentData &&
                departmentData.map((depttObject, index) =>
                  Object.entries(depttObject).map(([deptt], index) => (
                    <option key={index} value={depttObject.dept_name}>
                      {depttObject.dept_name}
                    </option>
                  ))
                )}
            </Field>
            <ErrorMessage name="deptt" component="p" className="error" />

            <label htmlFor="message" className="form-label">
              <strong>Please feel free to leave any Feedback here</strong>
            </label>
            <Field
              as="textarea"
              className="form-control"
              id="message"
              name="message"
              rows="4"
              cols="8"
            />
            <ErrorMessage name="message" component="p" className="error" />

            <Field
              type="text"
              className="custom-textbox"
              name="message_by"
              placeholder="Enter your good name please..."
            />
            <ErrorMessage name="message_by" component="p" className="error" />

            <button
              type="submit"
              className="btn btn-primary"
              disabled={isSubmitting}
            >
              Save Feedback
            </button>
          </Form>
        )}
      </Formik>
    </div>
  );
}
